  profiler casts aboard FAIRWEATHER as part of project M-R908-FA-08 in the Bering
  Sea and North Pacific Ocean from 2008-08-08 to 2008-08-09 (NCEI Accession 0130769)\",\n\t\"tracking_summary\":
