  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130769 includes physical
  and profile data collected aboard the FAIRWEATHER during project M-R908-FA-08 in
  the Bering Sea and North Pacific Ocean from 2008-08-08 to 2008-08-09. These data
  include SOUND VELOCITY. The instruments used to collect these data include CTD and
  sound velocimeter - moving vessel profiler. These data were collected and submitted
  by the NOAA Office of Coast Survey in support of hydrographic multibeam surveys
  to meet NOAA charting requirements.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
